import React from "react";

const Navbar = () => {
  return (
    <nav className="navbar navbar-expand-lg navbar-light mt-3">
      <div className="container-fluid px-4 mx-4">
        <button className="btn btn-secondary px-4">Doggo</button>
        <div className="navbar-nav ms-auto mb-2 mb-lg-0">
          <button className="btn btn-secondary px-4 mx-4">List</button>
          <button className="btn btn-secondary px-4 mx-4">Track</button>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
